import React, { Component } from "react";

import "./Node.css";

export default class Node extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const { col, row, isFinish, isStart, actualValue } = this.props;
    this.setState({
      row: row,
      col: col
    })
    const extraClassName = isFinish
      ? "node-finish"
      : isStart
      ? "node-start"
      : "";
    return (
      <input
        id = {`node-${row}-${col}`}
        value = {actualValue}
        type="number"
        max = '9'
        min = '0'
        className={`node ${extraClassName}`}
        placeholder={actualValue}
        onInput={(event) => this.props.inputValueChange(this.row,this.col,event)}
      ></input>
    )
  }
}

export const DEFAULT_NODE = {
  row: 0,
  col: 0,
};
